import React from "react";
import './Style/activities.css'
import activity1 from '../../../Global/assets/Digestive Glands.pdf'
const Activities = () => {
    return(
        <>
            <div className="Body" id="ExperimentsB">
                <embed src={activity1} width="100%" />
            </div>
        </>
    )
} 

export { Activities }
